import React, { useEffect } from 'react';

const BTCUSDTChart = () => {
  useEffect(() => {
    if (window.TradingView) {
      new window.TradingView.widget({
        width: '100%',
        height: 340,
        symbol: 'BINANCE:BTCUSDTPERP',
        interval: '15',
        theme: 'light',
        locale: 'kr',
        container_id: 'tradingview_btcusdt',
        style: '1',
        withdateranges: true,
        hide_side_toolbar: false,
        allow_symbol_change: false,
        details: false,
        hotlist: false,
        calendar: false
      });
    }
  }, []);

  return <div id="tradingview_btcusdt" style={{ width: '100%', height: 340, borderBottom: '1px solid #eee', background: '#fff', zIndex: 100 }} />;
};

export default BTCUSDTChart;
